import React from "react";
import { Button, Form, Icon, Message } from "semantic-ui-react";

export default function SignedIn() {
  return (
    <div>
      <Form inverted >
        <Form.Group >
          <Message size="hug" >
            <Message.Header><Icon name="add user" /> Sign Up Now</Message.Header>
            <p>
              Naxus'un fırsatlarla dolu dünyasına katıl!
            </p>
            <Button type="submit">Sign Up <Icon name="arrow alternate circle right"/></Button>
          </Message>
        </Form.Group>
      </Form>
    </div>
  );
}
